照射サイズを見やすい大きさに変更できるレーザーポインター<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />先端部を回すことで、照射サイズを約５～２０ｍｍ（距離３ｍの時）の大きさに調整することができ、より見やすいプレゼンテーションができます。遠くからでも明るく見える緑色光を採用。色覚の個人差を問わずレーザー光の視認性が向上するように配慮しました。最大出力１ｍＷ（クラス２）で２００ｍ先のオブジェクトに対しても照射可能。広い会場や教室でも力を発揮します。消費生活用製品安全法に適合。<BR>●本体サイズ：φ１３長さ１７０ｍｍ●重量：約６４ｇ（電池含む）●材質：本体・キャップ／アルミ、ボタン／ラバー●仕様：発光部／半導体励起固体レーザー、波長／５３２ｎｍ（緑色光）●最大出力：１ｍＷ（クラス２）●ビーム到達距離／約２００ｍ（ポイントサイズ：最小、夜間使用時）●ビーム径：ポイント最小～最大／約５～２０ｍｍ（距離３ｍの時）●付属品：単４形アルカリ乾電池２本（お試し用）●電池寿命：アルカリ乾電池使用時／連続使用約４時間（約２５℃環境時）●点灯：レーザーボタンを押している間だけ点灯します。●鉛フリーはんだ使用●保証期間：1年<BR><BR><BR><BR><BR>こくよ　ＫＯＫＵＹＯ　指示棒　指し棒　ＥＬＰ－Ｇ２５　ＥＬＰＧ２５　緑　ミドリ　みどり　グリーン　プロジェクター用品　プレゼンテーション　レーザー　光　講義　会議　４倍　カメラ　ＡＶ機器<style type="text/css">
